import './App.css';
import AddRow from './components/AddRow';

function Row() {
  return(
    alert()
  )
}
function App() {
  return (
    <div className="App">
      <div id="table-div">
        <table>
          <tr id='header'> 
            <th id='header' colspan="3">NCSA Lab Hours Tracker</th>
          </tr>
          <tr id='col_names'>
            <td id='date'>Date</td>
            <td id='name'>Name</td>
            <td id='time'>Time</td>
          </tr>
        </table>
      </div>
      <div id= "buttons">
        <button onClick={AddRow}>Add Row</button> <br/>
        <button>Remove Row</button>
      </div>
    </div>
  );
}

export default App;
